import React from 'react';

// CSS
import styles from './Tags.module.scss';

const Tags = (props) => {
    const customClass = [styles.tag];
    if (props.customclass && props.customClass === props.value) customClass.push(styles[props.customclass]);
    return (
        <span
            onClick={() => props.clicked(props.value)}
            className={customClass.join(' ')}>
            {props.children}
        </span>
    );
};

export default Tags;
